let commonurl = 'http://zzh.hzysofti.com:8001/api/v1/module/'
let javaService = {
    lssfzm(t, params, data){
        let p = new Promise((resolve, reject)=>{
            params.data = 'data:image/jpeg;base64,'
            t.$axios({
                method: "post",
                url: commonurl + "lssfzm",
                headers: {
                    "Content-Type": "application/json",
                    Accept: "application/json;charset=UTF-8"
                },
                params: params,
                data: data
            }).then(res => {
                resolve(res)
            });
        })
        return p
        
    },
    wfzjlzm(t, params){
        t.$http.post(commonurl + 'wfzjlzm',params,{emulateJSON:true}).then((res)=>{
            console.log(res)  
        },function(res){
            console.log(res);
        });
    },
    
}
export { javaService }